function Invoke-BaselineRegistryAudit {

    [CmdletBinding()] Param(
        [Parameter(Mandatory=$true)]
        [object]
        $BaselineItem
    )

    switch ($BaselineItem.RegType) {
        "REG_DWORD" {
            $ExpectedValue = [UInt32] $BaselineItem.RegData
        }
        "REG_SZ" {
            $ExpectedValue = [string] $BaselineItem.RegData
        }
        "REG_EXPAND_SZ" {
            $ExpectedValue = [string] $BaselineItem.RegData
        }
        default {
            throw "Unhandled registry type value"
        }
    }

    $Item = Get-ItemProperty -Path "Registry::$($BaselineItem.Key)" -Name $BaselineItem.Value -ErrorAction SilentlyContinue -ErrorVariable ErrorGetItemProperty
    $ValueToCheck = $Item.$($BaselineItem.Value)


    $BaselineItem | Add-Member -MemberType "NoteProperty" -Name "State" -Value $ValueToCheck
    $BaselineItem | Add-Member -MemberType "NoteProperty" -Name "Compliant" -Value $($ValueToCheck -eq $ExpectedValue)
    $BaselineItem
}

function ConvertTo-RegistryBaselineItem {
    <#
    .SYNOPSIS
    Short description
    
    .DESCRIPTION
    Long description
    
    .PARAMETER SecurityTemplate
    Parameter description
    
    .EXAMPLE
    An example
    
    .NOTES
    MACHINE\System\CurrentControlSet\Control\Lsa\MSV1_0\allownullsessionfallback=4,0 <- Expected value
    ^       ^                                           ^                        ^
    |       |                                           |                        |
    Hive    Key                                         Value                    RegType (enum value)
    #>
    
    [CmdletBinding()] Param(
        [object]
        $SecurityTemplate
    )

    if (-not ($SecurityTemplate.Section -like "Registry Values")) { return }

    $LineItem = $SecurityTemplate.LineItem
    # MACHINE\System\CurrentControlSet\Control\Lsa\MSV1_0\allownullsessionfallback=4,0

    $LineItemSplit = $LineItem.Split(",")
    $RegData = $LineItemSplit[1]
    $LineItem = $LineItemSplit[0]
    # MACHINE\System\CurrentControlSet\Control\Lsa\MSV1_0\allownullsessionfallback=4

    $LineItemSplit = $LineItem.Split("=")
    $RegTypeId = [UInt32] $LineItemSplit[1]
    $LineItem = $LineItemSplit[0]
    # MACHINE\System\CurrentControlSet\Control\Lsa\MSV1_0\allownullsessionfallback

    $LineItemSplit = $LineItem.Split("\")
    $HiveName = $LineItemSplit[0]
    $Key = $LineItemSplit[1..($LineItemSplit.length - 2)] -join "\"
    $Value = $LineItemSplit[$LineItemSplit.length - 1]
    
    switch ($HiveName) {
        "MACHINE" { $Hive = "HKLM" }
        "USER" { $Hive = "HKCU" }
        default { throw "Unknown hive name" }
    }

    switch ($RegTypeId) {
        1 { $RegType = "REG_SZ" }
        2 { $RegType = "REG_EXPAND_SZ" }
        3 { $RegType = "REG_BINARY" }
        4 { $RegType = "REG_DWORD" }
        7 { $RegType = "REG_MULTI_SZ" }
        11 { $RegType = "REG_QWORD" }
        default { throw "Unknown registry value type id" }
    }

    $BaselineItem = New-Object -TypeName PSObject
    $BaselineItem | Add-Member -MemberType "NoteProperty" -Name "PolicyName" -Value $SecurityTemplate.PolicyName
    $BaselineItem | Add-Member -MemberType "NoteProperty" -Name "Key" -Value "$Hive\$($Key)"
    $BaselineItem | Add-Member -MemberType "NoteProperty" -Name "Value" -Value $Value
    $BaselineItem | Add-Member -MemberType "NoteProperty" -Name "RegType" -Value $RegType
    $BaselineItem | Add-Member -MemberType "NoteProperty" -Name "RegData" -Value $RegData
    $BaselineItem
}

function Invoke-BaselineAudit {

    [CmdletBinding()] Param(
        [Parameter(Mandatory=$true)]
        [ValidateSet("Internet Explorer", "Computer", "User", "Defender Antivirus", "Credential Guard", "BitLocker", "Domain Security", "OfficeComputer", "OfficeUser", "EdgeComputer")]
        [string]
        $Category
    )

    $MachineRole = $((Invoke-MachineRoleCheck).Role)

    switch ($Category) {
        "Internet Explorer" {
            $Baseline = Get-SecurityBaseline -Category "ComputerConfig" | Where-Object { $_.PolicyName -Like "*Internet Explorer*" }
            $Baseline += Get-SecurityBaseline -Category "UserConfig" | Where-Object { $_.PolicyName -Like "*Internet Explorer*" }
            $Baseline | Where-Object { $null -ne $_} | ForEach-Object { Invoke-BaselineRegistryAudit -BaselineItem $_ }
        }
        "Computer" {
            Invoke-ComputerBaselineAudit -Role $MachineRole
        }
        "User" {
            $Baseline = Get-SecurityBaseline -Category "UserConfig" | Where-Object { $_.PolicyName -Like "*User*" }
            $Baseline | Where-Object { $null -ne $_ } | ForEach-Object { Invoke-BaselineRegistryAudit -BaselineItem $_ }
        }
        "Defender Antivirus" {
            $Baseline = Get-SecurityBaseline -Category "ComputerConfig" | Where-Object { $_.PolicyName -Like "*Defender Antivirus*" }
            $Baseline | Where-Object { $null -ne $_ } | ForEach-Object { Invoke-BaselineRegistryAudit -BaselineItem $_ }
        }
        "Credential Guard" {
            $Baseline = Get-SecurityBaseline -Category "ComputerConfig" | Where-Object { $_.PolicyName -Like "*Credential Guard*" }
            $Baseline | Where-Object { $null -ne $_ } | ForEach-Object { Invoke-BaselineRegistryAudit -BaselineItem $_ }
        }
        "BitLocker" {
            $Baseline = Get-SecurityBaseline -Category "ComputerConfig" | Where-Object { $_.PolicyName -Like "*BitLocker*" }
            $Baseline | Where-Object { $null -ne $_ } | ForEach-Object { Invoke-BaselineRegistryAudit -BaselineItem $_ }
        }
        "Domain Security" {
            throw "Domain Security category is not implemented"
        }
        "OfficeComputer" {
            $Baseline = Get-SecurityBaseline -BaselineProfile "Office" -Category "ComputerConfig"
            $Baseline | Where-Object { $null -ne $_ } | ForEach-Object { Invoke-BaselineRegistryAudit -BaselineItem $_ }
        }
        "OfficeUser" {
            $Baseline = Get-SecurityBaseline -BaselineProfile "Office" -Category "UserConfig"
            $Baseline | Where-Object { $null -ne $_ } | ForEach-Object { Invoke-BaselineRegistryAudit -BaselineItem $_ }
        }
        "EdgeComputer" {
            $Baseline = Get-SecurityBaseline -BaselineProfile "Edge" -Category "ComputerConfig"
            $Baseline | Where-Object { $null -ne $_ } | ForEach-Object { Invoke-BaselineRegistryAudit -BaselineItem $_ }
        }
    }
}

function Invoke-ComputerBaselineAudit {
    <#
    .SYNOPSIS
    Short description
    
    .DESCRIPTION
    Long description
    
    .PARAMETER Role
    Parameter description
    
    .NOTES
    Policy name sample values:
        - MSFT Windows 10 21H - Computer
        - MSFT Windows Server 2004 - Member Server
        - MSFT Windows Server 2004 - Domain Controller
    #>

    [CmdletBinding()] Param(
        [Parameter(Mandatory=$true)]
        [ValidateSet("Workstation", "Server", "Domain Controller")]
        [string]
        $Role
    )

    switch ($Role) {
        "Workstation" { $Filter = "*Computer*" }
        "Server" { $Filter = "*Member Server*" }
        "Domain Controller" { $Filter = "*Domain Controller*" }
    }

    # Get registry values from Computer and User config
    $Baseline = Get-SecurityBaseline -Category "ComputerConfig" | Where-Object { $_.PolicyName -Like "*Windows*" -and $_.PolicyName -Like $Filter }
    $Baseline += Get-SecurityBaseline -Category "UserConfig" | Where-Object { $_.PolicyName -Like "*Windows*" -and $_.PolicyName -Like $Filter }

    # Get registry values from security templates
    $BaselineTemp = Get-SecurityBaseline -Category "SecurityTemplate" | Where-Object { $_.PolicyName -Like "*Windows*" -and $_.PolicyName -Like $Filter }
    $Baseline += $BaselineTemp | ForEach-Object { ConvertTo-RegistryBaselineItem -SecurityTemplate $_ }
    
    $Baseline | Where-Object { $null -ne $_} | ForEach-Object { Invoke-BaselineRegistryAudit -BaselineItem $_ }
}